c     calculates interference of Born with
c     one loop SQCD diagrams that contain a Higgs boson
c     for: q qbar -> sl slbar g
c     with u-type quark q
c
c     returns sum M_B* M_V_Higgs
c
c     assumptions:
c     left- or right-sleptons
c     incoming quarks (generation 1 and 2) massless
c     same mass for all squarks
c
c     a factor (4 Pi)^eps/Gamma[1-eps] with eps=(4-d)/2
c     is implied but irrelevant here (no eps poles)
      subroutine virtualHiggsuubar(p,virtualHiggs)
      implicit none

      include 'nlegborn.h'
      include 'pwhg_st.h'    ! renormalization scale and strong coupling

      include 'MODEL/sm_read_values.inc'
      ! contains:
      ! + alpha: alpha_em(M_Z)^MSbar read from MODEL/param_card.dat
      ! + gfermi: G_F [GeV^-2] read from MODEL/param_card.dat
      ! + ...

      include 'coupl.inc'
      ! contains:
      ! + masses of SM particles read from MODEL/param_card.dat
      !   wmass (from SLHA file)
      !   zmass (Z-Boson pole mass)
      !   bmass (bottom quark mass mb(mb)^MSbar)
      !   tmass (top quark pole mass)
      ! + masses of SUSY particles read from MODEL/param_card.dat in the form
      !   m* with the particle name * specified in MODEL/particles.dat
      !   slightly different names for slepton masses
      !   mel/mer left-/right-handed selectron mass
      !   mml/mmr left-/right-handed smuon mass
      !   ml1/ml2 stau 1/2 mass
      !   but the masses and the mixing matrix of the sleptons under consideration
      !   can be found in PhysPars.h
      ! + ...

      include 'PhysPars.h'
      ! contains:
      ! + masses of the slepton pair under consideration
      !   ph_slepton3mass, ph_slepton4mass
      ! + and the mixing matrix of this slepton pair with entries
      !   ph_c_U3l, ph_c_U3r, ph_c_U4l, ph_c_U4r

      double precision  sw, sw2, cw, tw, s2w, c2w, e, gx, gz,
     &                  qe, qu, qd, t3e, t3v, t3u, t3d, rt2, ppi,
     &                  r_lc(2,2), r_bc(2,2), r_tc(2,2)
      common /ewparam/  sw, sw2, cw, tw, s2w, c2w, e, gx, gz,
     &                  qe, qu, qd, t3e, t3v, t3u, t3d, rt2, ppi,
     &                  r_lc, r_bc, r_tc
      ! contains:
      ! + sw: sine of Weinberg angle
      !   calculated in MODEL/couplings.f subroutine INIT_SUSY
      ! + r_lc: stau mixing matrix read from MODEL/param_card.dat
      ! + r_bc: sbottom mixing matrix read from MODEL/param_card.dat
      ! + r_tc: stop mixing matrix read from MODEL/param_card.dat
      ! + ...

      ! external variables
      real *8 p(0:3,nlegborn)
      complex *16 virtualHiggs
      ! internal variables
      logical ini_Higgs
      data ini_Higgs/.true./
      save ini_Higgs
      ! SW2, CW part of MadGraph common block ewparam
      real *8 Alfa2, Alfas2, alphaHiggs, betaHiggs,
     &        CA, CAB, CB, CB2, CW2, finite,
     &        mdlSq, mdrSq, mslSq, msrSq, mb1Sq, mb2Sq,
     &        mulSq, murSq, mclSq, mcrSq, mt1Sq, mt2Sq,
     &        MB, MGl2, Mh02, MHH2, MM, MM2,
     &        mSlepSq, mSquarkSq, MT, MW, MW2, MZ, MZ2,
     &        p12, p13, p14, p24, p34, pi,
     &        SA, SAB, SB,
     &        tagGluino, tagh0, tagHH, tagSquark, tagZ,
     &        tb, tgb,
     &        USfSlep11, USfSlep12
      save tgb
      ! more Higgs parameters
      complex *16 Af222, Af333, Af433, eps1234, MUE,
     &   mixh0Sl, mixHHSl, mixZSl

      ! functions
      real *8 sprod, levicivitacontract
      ! variables for READ_BLOCK_HMIX (reads tan(beta))
      integer ii
      character line1*6, line2*100
      integer nin2
      real*8  unimass(20),lowmass(0:99)
      logical done, fopened
      ! variables for QCDLoop
      real *8 mu2
      integer ep
      complex *16 qlI1, qlI2, qlI3, qlI4


      ! initialize parameters
      virtualHiggs = dcmplx(0)

      mu2 = st_muren2
      ep  = 0

      Alfa2   = alpha**2
      Alfas2  = st_alpha**2

      ! read Higgs parameters from SLHA file
      if (ini_Higgs) then
         tgb = -999d0
         SA  = -999d0
         unimass(10) = -999d0
         lowmass(0) = -999d0
         nin2=23 ! Read SUSY LHA file
         call open_file_mdl(nin2,"param_card.dat",fopened)
         if(.not.fopened)
     &        stop 'Error: could not open file param_card.dat'
         do ii=1,300,1
            line1 = ' '
            read(nin2,'(a6,a100)') line1,line2
            if (line1(1:1).eq.'B') then
               if (line2(1:4).eq.'HMIX') then
                  call READ_BLOCK_HMIX(nin2,lowmass,unimass,done)
               endif
               if (line2(1:5).eq.'ALPHA') then
                  call READ_BLOCK_ALPHA(nin2,lowmass,done)
               endif
               if (line2(1:2).eq.'AD') then
                  call READ_BLOCK_AD(nin2,lowmass,done)
               endif
               if (line2(1:2).eq.'AE') then
                  call READ_BLOCK_AE(nin2,lowmass,done)
               endif
               if (line2(1:2).eq.'AU') then
                  call READ_BLOCK_AU(nin2,lowmass,done)
               endif
            endif
         enddo
         tgb   = unimass(10) ! tan(beta)
         SA    = lowmass(44) ! sin(alpha)
         MUE   = lowmass(0)  ! mu
         Af222 = -lowmass(36) ! A_tau
         Af333 = -lowmass(24) ! A_top
         Af433 = -lowmass(21) ! A_bottom
         close(nin2)
      endif

      alphaHiggs = dasin(SA)
      betaHiggs  = datan(tgb)
      CA  = dcos(alphaHiggs)
      CAB = dcos(alphaHiggs+betaHiggs)
      CB  = dcos(betaHiggs)
      CB2 = CB**2
      SAB = dsin(alphaHiggs+betaHiggs)
      SB  = dsin(betaHiggs)
      TB  = tgb

      ! SW2, CW already have value from MadGraph, in common block ewparam
      CW2 = CW**2
      eps1234 = dcmplx(0,-1)*
     &          levicivitacontract(p(0,1), p(0,2), p(0,3), p(0,4))
      finite  = 1d0
      pi = 3.141592653589793238462643383279502884197D0

      p12 = sprod(p(0,1),p(0,2))
      p13 = sprod(p(0,1),p(0,3))
      p14 = sprod(p(0,1),p(0,4))
      ! p23 eliminated with Mandelstam relation
      p24 = sprod(p(0,2),p(0,4))
      p34 = sprod(p(0,3),p(0,4))

      MB      = 0d0
      MGl2    = MGO**2
      Mh02    = mh1**2
      MHH2    = mh2**2
      MM      = 0d0
      MM2     = MM**2
      mSlepSq = ph_slepton3mass**2
      MT      = tmass
      MW      = wmass
      MW2     = MW**2
      MZ      = zmass
      MZ2     = zmass**2

      ! all squarks are assumed to have the same mass
      mSquarkSq = mdl**2

      ! identify left- or right-sleptons (no slepton mixing assumed)
      select case(int(ph_c_U3l*1d6))
      case (1000000) ! left
         USfSlep11 = 1d0
         USfSlep12 = 0d0
      case (0) !right
         USfSlep11 = 0d0
         USfSlep12 = 1d0
      case default
        write(*,*) 'unhandled slepton mixing in virtualHiggsuubar'
        write(*,*) 'ph_c_U3l = ', ph_c_U3l
        stop
      end select

      mixh0Sl =
     & (USfSlep11*(CW*MM2*SA*dble(2) + 
     -        CB*MW*MZ*SAB*(dble(-1) + SW2*dble(2))) + 
     -     CW*MM*USfSlep12*
     -      (Af222*SA + CA*dconjg(dcmplx(MUE))))*
     -   dconjg(dcmplx(USfSlep11)) + 
     -  (CB*MW*MZ*SAB*SW2*USfSlep12*dble(-2) + 
     -     CW*MM2*SA*USfSlep12*dble(2) + 
     -     CW*MM*USfSlep11*
     -      (CA*MUE + SA*dconjg(dcmplx(Af222))))*
     -   dconjg(dcmplx(USfSlep12))

      mixHHSl =
     & (USfSlep11*(CA*CW*MM2*dble(-2) + 
     -        CAB*CB*MW*MZ*(SW2*dble(-2) + dble(1))) + 
     -     CW*MM*USfSlep12*
     -      (Af222*CA*dble(-1) + SA*dconjg(dcmplx(MUE))))*
     -   dconjg(dcmplx(USfSlep11)) + 
     -  (CA*CW*MM2*USfSlep12*dble(-2) + 
     -     CAB*CB*MW*MZ*SW2*USfSlep12*dble(2) + 
     -     CW*MM*USfSlep11*
     -      (MUE*SA + CA*dble(-1)*dconjg(dcmplx(Af222))))*
     -   dconjg(dcmplx(USfSlep12))

      mixZSl     =
     &  USfSlep11*(dble(-1) + SW2*dble(2))*
     -  dconjg(dcmplx(USfSlep11)) + 
     -  SW2*USfSlep12*dble(2)*dconjg(dcmplx(USfSlep12))

      ! set tags
      ! if tagX set to 0d0: all diagrams with particle X omitted
      ! if tagX set to 1d0: all diagrams with particle X included
      !                     (unless omitted by other tags)
      tagGluino = 1d0
      tagh0     = 1d0
      tagHH     = 1d0
      tagSquark = 1d0
      tagZ      = 1d0

      ! calculate result
      virtualHiggs =
     +(Alfa2*Alfas2*CB**dble(-1)*CB2**dble(-1)*CW*CW2**dble(-2)*
     -     finite*mixh0Sl*MW2**dble(-1)*p12**dble(-1)*
     -     (mSlepSq + p34)**dble(-1)*Pi**dble(2)*SB**dble(-1)*
     -     SW2**dble(-2)*tagh0*tagSquark*dble(-32)*
     -     (p12 + p13*dble(-1) + p14*dble(-1))**dble(-1)*
     -     (p12 + mSlepSq*dble(-1) + p34*dble(-1))**dble(-1)*
     -     (CA*CB2*MT**dble(2) + CB*MB**dble(2)*SA*SB*dble(-1))*
     -     (MZ2*dble(-1) + mSlepSq*dble(2) + p34*dble(2))**dble(-1)*
     -     (Mh02*dble(-1) + (mSlepSq + p34)*dble(2))**dble(-1)*
     -     (CW2*SW2*(MZ2*dble(-1) + mSlepSq*dble(2) + p34*dble(2))*
     -        (mSlepSq**dble(2)*(p12 + p14*dble(-1)) + 
     -          p12**dble(2)*(p34 + p14*dble(-1)) + 
     -          dble(-1)*(p13*(p14 + p24) + 
     -             p14*(p14 + p24 + p34*dble(-1)))*
     -           (p34*dble(-1) + p13*dble(2) + p14*dble(2)) + 
     -          p12*(p14*(p24 + p34*dble(-4)) + 
     -             p34*(p34 + p24*dble(-2)) + p14**dble(2)*dble(3) + 
     -             p13*(p24 + p14*dble(3))) + 
     -          mSlepSq*(p12**dble(2) + 
     -             p12*dble(-2)*(p24 + p34*dble(-1) + p14*dble(2)) + 
     -             p13*(p24 + p14*dble(3)) + 
     -             p14*(p24 + p34*dble(-2) + p14*dble(3))))*dble(8) + 
     -       (mSlepSq + p34)*tagZ*dble(-1)*
     -        (eps1234*(mSlepSq + p12 + p34)*dble(3) + 
     -          dble(-1)*(mSlepSq**dble(2)*(p12 + p14*dble(-1)) + 
     -             p12**dble(2)*(p34 + p14*dble(-1)) + 
     -             dble(-1)*(p13*(p14 + p24) + 
     -                p14*(p14 + p24 + p34*dble(-1)))*
     -              (p34*dble(-1) + p13*dble(2) + p14*dble(2)) + 
     -             p12*(p14*(p24 + p34*dble(-4)) + 
     -                p34*(p34 + p24*dble(-2)) + p14**dble(2)*dble(3) + 
     -                p13*(p24 + p14*dble(3))) + 
     -             mSlepSq*(p12**dble(2) + 
     -                p12*dble(-2)*(p24 + p34*dble(-1) + p14*dble(2)) + 
     -                p13*(p24 + p14*dble(3)) + 
     -                p14*(p24 + p34*dble(-2) + p14*dble(3))))*
     -           (dble(-3) + SW2*dble(8)))*dconjg(dcmplx(mixZSl))))/
     -   dble(3) + (Alfa2*Alfas2*CB**dble(-1)*CB2**dble(-1)*CW*
     -     CW2**dble(-2)*finite*mixHHSl*MW2**dble(-1)*p12**dble(-1)*
     -     (mSlepSq + p34)**dble(-1)*Pi**dble(2)*SB**dble(-1)*
     -     (CB2*MT**dble(2)*SA + CA*CB*MB**dble(2)*SB)*SW2**dble(-2)*
     -     tagHH*tagSquark*dble(-32)*
     -     (p12 + p13*dble(-1) + p14*dble(-1))**dble(-1)*
     -     (p12 + mSlepSq*dble(-1) + p34*dble(-1))**dble(-1)*
     -     (MZ2*dble(-1) + mSlepSq*dble(2) + p34*dble(2))**dble(-1)*
     -     (MHH2*dble(-1) + (mSlepSq + p34)*dble(2))**dble(-1)*
     -     (CW2*SW2*(MZ2*dble(-1) + mSlepSq*dble(2) + p34*dble(2))*
     -        (mSlepSq**dble(2)*(p12 + p14*dble(-1)) + 
     -          p12**dble(2)*(p34 + p14*dble(-1)) + 
     -          dble(-1)*(p13*(p14 + p24) + 
     -             p14*(p14 + p24 + p34*dble(-1)))*
     -           (p34*dble(-1) + p13*dble(2) + p14*dble(2)) + 
     -          p12*(p14*(p24 + p34*dble(-4)) + 
     -             p34*(p34 + p24*dble(-2)) + p14**dble(2)*dble(3) + 
     -             p13*(p24 + p14*dble(3))) + 
     -          mSlepSq*(p12**dble(2) + 
     -             p12*dble(-2)*(p24 + p34*dble(-1) + p14*dble(2)) + 
     -             p13*(p24 + p14*dble(3)) + 
     -             p14*(p24 + p34*dble(-2) + p14*dble(3))))*dble(8) + 
     -       (mSlepSq + p34)*tagZ*dble(-1)*
     -        (eps1234*(mSlepSq + p12 + p34)*dble(3) + 
     -          dble(-1)*(mSlepSq**dble(2)*(p12 + p14*dble(-1)) + 
     -             p12**dble(2)*(p34 + p14*dble(-1)) + 
     -             dble(-1)*(p13*(p14 + p24) + 
     -                p14*(p14 + p24 + p34*dble(-1)))*
     -              (p34*dble(-1) + p13*dble(2) + p14*dble(2)) + 
     -             p12*(p14*(p24 + p34*dble(-4)) + 
     -                p34*(p34 + p24*dble(-2)) + p14**dble(2)*dble(3) + 
     -                p13*(p24 + p14*dble(3))) + 
     -             mSlepSq*(p12**dble(2) + 
     -                p12*dble(-2)*(p24 + p34*dble(-1) + p14*dble(2)) + 
     -                p13*(p24 + p14*dble(3)) + 
     -                p14*(p24 + p34*dble(-2) + p14*dble(3))))*
     -           (dble(-3) + SW2*dble(8)))*dconjg(dcmplx(mixZSl))))/
     -   dble(3) + (Alfa2*Alfas2*CB**dble(-1)*CB2**dble(-1)*CW*
     -     CW2**dble(-2)*finite*mixHHSl*MW2**dble(-1)*p12**dble(-1)*
     -     (mSlepSq + p34)**dble(-1)*Pi**dble(2)*SB**dble(-1)*
     -     (CB2*MT**dble(2)*SA + CA*CB*MB**dble(2)*SB)*SW2**dble(-2)*
     -     tagHH*tagSquark*(MHH2 + (mSlepSq + p34)*dble(-2))**dble(-1)*
     -     (p12 + p13*dble(-1) + p14*dble(-1))**dble(-1)*
     -     (p13 + p14 + mSlepSq*dble(-1) + p34*dble(-1))**dble(-1)*
     -     (MZ2*dble(-1) + mSlepSq*dble(2) + p34*dble(2))**dble(-1)*
     -     dble(32)*(CW2*SW2*dble(-8)*
     -        (MZ2*dble(-1) + mSlepSq*dble(2) + p34*dble(2))*
     -        (mSlepSq**dble(2)*(p12 + p14*dble(-1)) + 
     -          p12**dble(2)*(p34 + p14*dble(-1)) + 
     -          dble(-1)*(p13 + p14 + p34*dble(-1))*
     -           (p13*(p14 + p24) + p14*(p14 + p24 + p34*dble(-1))) + 
     -          p12*(p14*(p24 + p34*dble(-3)) + 
     -             p34*(p34 + p24*dble(-2)) + p14**dble(2)*dble(2) + 
     -             p13*(p24 + p34*dble(-1) + p14*dble(2))) + 
     -          mSlepSq*(p12**dble(2) + p13*(p24 + p14*dble(2)) + 
     -             p14*(p24 + p34*dble(-2) + p14*dble(2)) + 
     -             p12*dble(-1)*
     -              (p13 + p34*dble(-2) + p24*dble(2) + p14*dble(3))))
     -        + (mSlepSq + p34)*tagZ*
     -        (eps1234*(mSlepSq + p12 + p34 + p13*dble(-1) + 
     -             p14*dble(-1))*dble(3) + 
     -          dble(-1)*(mSlepSq**dble(2)*(p12 + p14*dble(-1)) + 
     -             p12**dble(2)*(p34 + p14*dble(-1)) + 
     -             dble(-1)*(p13 + p14 + p34*dble(-1))*
     -              (p13*(p14 + p24) + p14*(p14 + p24 + p34*dble(-1)))
     -              + p12*(p14*(p24 + p34*dble(-3)) + 
     -                p34*(p34 + p24*dble(-2)) + p14**dble(2)*dble(2) + 
     -                p13*(p24 + p34*dble(-1) + p14*dble(2))) + 
     -             mSlepSq*(p12**dble(2) + p13*(p24 + p14*dble(2)) + 
     -                p14*(p24 + p34*dble(-2) + p14*dble(2)) + 
     -                p12*dble(-1)*
     -                 (p13 + p34*dble(-2) + p24*dble(2) + p14*dble(3)))
     -             )*(dble(-3) + SW2*dble(8)))*dconjg(dcmplx(mixZSl))))/
     -   dble(3) + (Alfa2*Alfas2*CB**dble(-1)*CB2**dble(-1)*CW*
     -     CW2**dble(-2)*finite*mixh0Sl*MW2**dble(-1)*p12**dble(-1)*
     -     (mSlepSq + p34)**dble(-1)*Pi**dble(2)*SB**dble(-1)*
     -     SW2**dble(-2)*tagh0*tagSquark*
     -     (CB*MB**dble(2)*SA*SB + CA*CB2*MT**dble(2)*dble(-1))*
     -     (p12 + p13*dble(-1) + p14*dble(-1))**dble(-1)*
     -     (p13 + p14 + mSlepSq*dble(-1) + p34*dble(-1))**dble(-1)*
     -     (MZ2*dble(-1) + mSlepSq*dble(2) + p34*dble(2))**dble(-1)*
     -     (Mh02*dble(-1) + (mSlepSq + p34)*dble(2))**dble(-1)*dble(32)*
     -     (CW2*SW2*dble(-8)*
     -        (MZ2*dble(-1) + mSlepSq*dble(2) + p34*dble(2))*
     -        (mSlepSq**dble(2)*(p12 + p14*dble(-1)) + 
     -          p12**dble(2)*(p34 + p14*dble(-1)) + 
     -          dble(-1)*(p13 + p14 + p34*dble(-1))*
     -           (p13*(p14 + p24) + p14*(p14 + p24 + p34*dble(-1))) + 
     -          p12*(p14*(p24 + p34*dble(-3)) + 
     -             p34*(p34 + p24*dble(-2)) + p14**dble(2)*dble(2) + 
     -             p13*(p24 + p34*dble(-1) + p14*dble(2))) + 
     -          mSlepSq*(p12**dble(2) + p13*(p24 + p14*dble(2)) + 
     -             p14*(p24 + p34*dble(-2) + p14*dble(2)) + 
     -             p12*dble(-1)*
     -              (p13 + p34*dble(-2) + p24*dble(2) + p14*dble(3))))
     -        + (mSlepSq + p34)*tagZ*
     -        (eps1234*(mSlepSq + p12 + p34 + p13*dble(-1) + 
     -             p14*dble(-1))*dble(3) + 
     -          dble(-1)*(mSlepSq**dble(2)*(p12 + p14*dble(-1)) + 
     -             p12**dble(2)*(p34 + p14*dble(-1)) + 
     -             dble(-1)*(p13 + p14 + p34*dble(-1))*
     -              (p13*(p14 + p24) + p14*(p14 + p24 + p34*dble(-1)))
     -              + p12*(p14*(p24 + p34*dble(-3)) + 
     -                p34*(p34 + p24*dble(-2)) + p14**dble(2)*dble(2) + 
     -                p13*(p24 + p34*dble(-1) + p14*dble(2))) + 
     -             mSlepSq*(p12**dble(2) + p13*(p24 + p14*dble(2)) + 
     -                p14*(p24 + p34*dble(-2) + p14*dble(2)) + 
     -                p12*dble(-1)*
     -                 (p13 + p34*dble(-2) + p24*dble(2) + p14*dble(3)))
     -             )*(dble(-3) + SW2*dble(8)))*dconjg(dcmplx(mixZSl))))/
     -   dble(3) + (Alfa2*Alfas2*CA*CB**dble(-1)*CW**dble(-1)*
     -     CW2**dble(-1)*finite*mixh0Sl*MT**dble(2)*MW2**dble(-1)*
     -     p12**dble(-1)*(mSlepSq + p34)**dble(-1)*Pi**dble(2)*
     -     SB**dble(-1)*SW2**dble(-2)*tagh0*dble(-16)*
     -     (p12 + p13*dble(-1) + p14*dble(-1))**dble(-1)*
     -     (p12 + mSlepSq*dble(-1) + p34*dble(-1))**dble(-1)*
     -     (p13 + p14 + mSlepSq*dble(-1) + p34*dble(-1))**dble(-1)*
     -     (MZ2*dble(-1) + mSlepSq*dble(2) + p34*dble(2))**dble(-1)*
